function Slide(e){this.elem=e,this.init()}function Slides(e){this.name="Hello";for(var l=document.querySelectorAll(e),t=[],s=0;s<l.length;s++)t.push(new Slide(l[s]));console.log("hello world")}Slide.prototype.fullScreen=function(){this.elem.requestFullscreen?this.elem.requestFullscreen():this.elem.mozRequestFullScreen?this.elem.mozRequestFullScreen():this.elem.webkitRequestFullscreen?this.elem.webkitRequestFullscreen():this.elem.msRequestFullscreen&&this.elem.msRequestFullscreen()},Slide.prototype.init=function(){var e=this;this.elem.addEventListener("click",function(){e.fullScreen()})};